<!DOCTYPE html>

<head>
	<meta charset="UTF-8">
	<title>Figma Renderer</title>
	<style>
		@import url('https://fonts.googleapis.com/css2?family=Lato');
	</style>
	</script>
	<style>
			:root {
		--figma_font_0: "Lato";
		--figma_font_1: "Zoho Puvi";
	}
		</style>
		<script>
			window.addEventListener("load", (event) => {
	var svgContainers = document.querySelectorAll("svg");
	for (var i = 0; i < svgContainers.length; i++) {
		var svgContainer = svgContainers[i];
		var parentContainer = svgContainer.parentNode;
		if(parentContainer.getAttribute("creatortag") == "zc_ratingoption") {
			continue;
		}
		var pathContainer = svgContainer.querySelector("path");
		var pathStylesJson = convertStringToStyleJson(svgContainer.getAttribute("stylemap"));
		if(pathContainer) {
			for (var eachStyle in pathStylesJson) {
				pathContainer.style[eachStyle] = pathStylesJson[eachStyle];
			}
		}
	}
});
convertStringToStyleJson = function(styleString) {
	var returnStyleJson = {};
	if(styleString) {		
		var stylePairs = styleString.split("; ");
		for(var stylePair of stylePairs) {
			var eachStylePair =  stylePair.split(":");
			returnStyleJson[eachStylePair[0]] = eachStylePair[1];
		}
	}
	return returnStyleJson;
}
</script>
